import React, {Component} from "react";
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';


class Todo extends Component {

    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="card py-xl-5 col-md-6">
                <div className="card-header">
                    {this.props.name}
                </div>

            </div>
        );
    }

}

export default Todo;
